function setup_horizontal_menu_hover($item, $sub) {
	var del = 0.5,
		trans_x = -10,
		ease = Quad.easeInOut;

	TweenMax.set($sub, {
		css: {
			autoAlpha: 0,
			transform: "translateX(" + trans_x + "px)"
		}
	});

	$item.hoverIntent({
		over: function () {
			if (isxs())
				return false;

			if ($sub.css('display') == 'none') {
				$sub.css({
					display: 'block',
					visibility: 'hidden'
				});
			}

			$sub.css({
				zIndex: ++public_vars.hover_index
			});
			TweenMax.to($sub, del, {
				css: {
					autoAlpha: 1,
					transform: "translateX(0px)"
				},
				ease: ease
			});
		},

		out: function () {
			if (isxs())
				return false;

			TweenMax.to($sub, del, {
				css: {
					autoAlpha: 0,
					transform: "translateX(" + trans_x + "px)"
				},
				ease: ease,
				onComplete: function () {
					TweenMax.set($sub, {
						css: {
							transform: "translateX(" + trans_x + "px)"
						}
					});
					$sub.css({
						display: 'none'
					});
				}
			});
		},

		timeout: 300,
		interval: 50
	});

}



